Waking up with our wedding all over The @nytimes is a dream come true ✨♥️😍 Knowing Our love is able to reach millions more people & inspire anyone who reads it to know how love truly does flutter into your life & how finding your soulmate can happen to you as easily as it did for me. 
Anyone who has already achieved the things that you are aiming to achieve can be ‘an Expander’ for you. When you look at things you want & people who have those things that you want with love and compassion in your heart, only then do you send out a super positive energy to the universe that says you are ready to receive it too. So that’s what I mean by the word Expander.. I hope to be someONE’s Expander too ✨
. 
So grateful to our tribe for bringing the glam and making this possible @staceyrosscohen PR SO grateful for you 🙏🏼♥️ 
@realjohngray for marrying us so perfectly
@alanapaterson for coming to capture the most magical photos 😍 
 @danytabet for my beautiful dress 
Tammy for such a beautiful interview with us 🙏🏼 
I love you @globaldegree

Remember, the entrance door to the sanctuary is inside you. A home is a kingdom of it's own in the midst of the world, a stronghold amid life's storms and stresses, a refuge, even a sanctuary. A true home is one of the most sacred of places. 🙏🏼♥️
Excited to spend time in our new home In Vancouver and host our retreats here for our VIP community 🙏🏼❤️ 
@globaldegree
